export default function LocationsPage () {
    return (
      <div>       
          <GridContainer>
            <GridItem xs={12} sm={12} md={8}>
              <Fragment>
                <LocationRoute />
              </Fragment>
            </GridItem>
          </GridContainer>
        </div>        
      );
    }
